import React from 'react';
import { Link } from 'react-router-dom';
import './Dashboard.css'; // (optional for styling)

function Dashboard() {
  return (
    <div>
      {/* NavBar */}
      <nav style={styles.navbar}>
        <div style={styles.leftNav}>
          <span style={styles.title}>Teacher Dashboard</span>
        </div>
        <div style={styles.rightNav}>
          <Link to="/" style={styles.link}>Home</Link>
          <Link to="/semesters" style={styles.link}>Semesters</Link>
          <Link to="/profile" style={styles.link}>Profile</Link>
          <Link to="/logout" style={styles.link}>Logout</Link>
        </div>
      </nav>

      {/* Body */}
      <div style={styles.body}>
        <div style={styles.card}>
          <h2>Welcome Teacher!</h2>
          <Link to="/semesters" style={styles.cardLink}>View Semesters</Link>
        </div>
      </div>
    </div>
  );
}

const styles = {
  navbar: {
    display: 'flex',
    justifyContent: 'space-between',
    backgroundColor: '#222',
    color: '#fff',
    padding: '10px 20px'
  },
  leftNav: { fontWeight: 'bold' },
  rightNav: {
    display: 'flex',
    gap: '20px',
  },
  link: {
    color: '#fff',
    textDecoration: 'none'
  },
  body: {
    display: 'flex',
    justifyContent: 'center',
    marginTop: '50px',
  },
  card: {
    backgroundColor: '#f5f5f5',
    padding: '30px',
    borderRadius: '10px',
    textAlign: 'center'
  },
  cardLink: {
    display: 'inline-block',
    marginTop: '15px',
    padding: '10px 20px',
    backgroundColor: '#007bff',
    color: 'white',
    textDecoration: 'none',
    borderRadius: '5px'
  }
};

export default Dashboard;
